import React from 'react'


function App(){
    let currDate = new Date(2020,10,21,14)
    currDate = currDate.getHours()
    let greeting = ''
    const cssStyle = {}
    if (currDate >= 1 && currDate <12){
        greeting = 'Good Morning'
        cssStyle
    }
}
